import React from 'react';
import { useNavigate } from 'react-router-dom';
import './ReadAnimalPage.css'; // Importa el archivo de estilos

const ReadAnimalPage = () => {
    const navigate = useNavigate();

    return (
        <div className="read-container">
            <h1 className="read-title">Detalles de Animales</h1>
            <form className="read-form">
                <div className="form-group">
                    <input type="checkbox" id="nameCheckbox" />
                    <label htmlFor="nameCheckbox">Buscar por Nombre:</label>
                    <input type="text" id="searchName" disabled />
                </div>

                <div className="form-group">
                    <input type="checkbox" id="idCheckbox" />
                    <label htmlFor="idCheckbox">Buscar por ID:</label>
                    <input type="text" id="searchId" disabled />
                </div>

                <div className="form-group">
                    <input type="checkbox" id="habitatCheckbox" />
                    <label htmlFor="habitatCheckbox">Buscar por Hábitat:</label>
                    <input type="text" id="searchHabitat" disabled />
                </div>
            </form>

            <button
                type="button"
                className="read-back-button"
                onClick={() => navigate('/')}
            >
                Atrás
            </button>
        </div>
    );
};

export default ReadAnimalPage;
